import React, { Component } from 'react'
import {Link} from 'react-router-dom';
import Logout from '../../Logout';
import axios from 'axios';

const ArticleList = (props) => {

    console.log(articles);

    let articles;
    let tableTemplate = <table border="1">
        <th>id</th>
        <th>title</th>
        <th>author</th>
    </table>;

    axios.get('/api/articles')
    .then(res => {
            articles = res.data.map((article) => <tr id={article.id}>
                <td> {article.id} </td>
                <td> {article.title} </td>
                <td> {article.author}</td>
                </tr>
            )
        }
    );

    return (  
        <div className="ArticleList">
            <ul className="AritleListContainer">
                <li> id:0 post one author:kim </li>
                <li> id:1 post two author:park</li>
                <li> id:2 post three author:jim</li>
            </ul>

            <button className="ArticleCreate" id="create-article-button" name="create-article-button">Create</button> <br/>
            <Link to='/login'>Login Page</Link>
            <Logout history={props.history} />
        </div>

    )
}

export default (ArticleList);
